import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import { Container , Paper, Button} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),

    },
  },
}));

export default function Student() {
    const paperStyle={padding:'50px 20px', width:600,margin:"20px auto"}
    const[name,setName]=useState('')
    const[address,setAddress]=useState('')
    const classes = useStyles();

  const handleClick=(e)=>{
    e.preventDefault()
    console.log("clicked")
    const student={name,address}
    console.log(student)
//     fetch("http://localhost:8082/club/add",{
//       method:"POST",
//       headers:{"Content-Type":"application/json"},
//       body:JSON.stringify(student)

//   }).then(()=>{
//     console.log("New Club added")
//   })
}

    function onFormsSubmit() {
        setName("")
        setAddress("")
    }

  return (
    <Container>
        <Paper elevation={3} style={paperStyle}>
            <h1 style={{color:"blue"}}><u>Add Club</u></h1>

    <form className={classes.root} noValidate autoComplete="off" onSubmit={() => onFormsSubmit()}>

      <TextField id="outlined-basic" label="Student Name" variant="outlined" fullWidth 
      value={name}
      onChange={(e)=>setName(e.target.value)}
      />
      <TextField id="outlined-basic" label="Student Adress" variant="outlined" fullWidth
      value={address}
      onChange={(e)=>setAddress(e.target.value)}
      />
      <Button variant="contained" color="secondary" onClick={handleClick}>
  Add club
</Button>
    </form>

    </Paper>

    </Container>
  );
}
